export function add35(a: number, b: number): number {
  return a + b;
}

export function subtract35(a: number, b: number): number {
  return a - b;
}

export function multiply35(a: number, b: number): number {
  return a * b;
}

export function divide35(a: number, b: number): number {
  return a / b;
}
